import React, { useEffect } from "react";
import { Row, FormGroup, Input, Button, Form, Col } from "reactstrap";
import { useForm, Controller } from "react-hook-form";
import { yupResolver } from "@hookform/resolvers/yup";
import * as yup from "yup";
import { useDispatch } from "react-redux";
import { carsData } from "../redux/actions";

const carpreferenceSchema = yup.object().shape({
  email: yup.string().required("*Email is Required"),
  password: yup.string().required("*Password is Required"),
});

const CarPreference = () => {
  const { control, register, handleSubmit, errors } = useForm({
    resolver: yupResolver(carpreferenceSchema),
  });
  const dispatch = useDispatch();

  const { loading, carmake } = useSelector((state) => ({
    loading: state.CarReducer.loading,
    carmake: state.CarReducer.carmake,
  }));

  useEffect(() => {
    dispatch(carsData());
  }, [dispatch]);
  return (
    <>
      <Form className="searchform">
        <Row>
          <Col md={12}>
            <h4 className="home-rightside-title">Select Car Preferences</h4>
          </Col>
          <Col>
            <p className="home-rightside-subtitle">
              * indicates mandatory field.
            </p>
          </Col>
        </Row>
        <Row>
          <Col md={6}>
            <FormGroup>
              <Controller
                as={Input}
                type="select"
                name="cartype"
                control={control}
                ref={register}
                placeholder=" Car Type*"
              >
                <option>Car Type*</option>
              </Controller>
            </FormGroup>
          </Col>
          <Col md={6}>
            <FormGroup>
              <Controller
                as={Input}
                type="select"
                name="carmake"
                control={control}
                ref={register}
                placeholder=" Car Make*"
                options={carmake}
              >
                <option>Car Make*</option>
              </Controller>
            </FormGroup>
          </Col>
        </Row>
        <Row>
          <Col md={6}>
            <FormGroup>
              <Controller
                as={Input}
                type="select"
                name="carmodel"
                control={control}
                ref={register}
                placeholder=" Car Model*"
              >
                <option>Car Model*</option>
              </Controller>
            </FormGroup>
          </Col>
          <Col md={6}>
            <FormGroup>
              <Controller
                as={Input}
                type="select"
                name="estimetedcredit"
                control={control}
                ref={register}
                placeholder=" Estimated Score*"
              >
                <option> Estimated Credit Score*</option>
              </Controller>
            </FormGroup>
          </Col>
        </Row>
        <Row>
          <Col md={6}>
            <FormGroup>
              <Controller
                as={Input}
                type="select"
                name="milesfrom"
                control={control}
                ref={register}
                placeholder=" 50 Miles From*"
              >
                <option>50 Miles From*</option>
              </Controller>
            </FormGroup>
          </Col>
          <Col md={6}>
            <FormGroup>
              <Controller
                as={Input}
                type="select"
                name="zipcode"
                control={control}
                ref={register}
                placeholder="Zip Code*"
              >
                <option>Zip Code*</option>
              </Controller>
            </FormGroup>
          </Col>
        </Row>
        <Row>
          <Col md={12}>
            <Button className="signin-button ">GET STARTED</Button>
          </Col>
        </Row>
      </Form>
    </>
  );
};

export default CarPreference;
